script: |
  super -f text -I q3264.spq | sort > q3264.out

inputs:
  - name: q3264.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT 78 <> - col2 * + ( - col0 ) * col2 + + col2 + CAST ( - - col0 AS INTEGER );
  - name: tab0

outputs:
  - name: q3264.out
    data: |
